/* Generated File Run.js in Project baru */	function close_baru(){	Minimizer.close("baru");}	function minimize_baru(){	Minimizer.minimize("baru");}	function maximize_baru(){	Minimizer.maximize("baru");}function open_baru(){}/* Initialize application */			function init_baru(){	$("#body-baru").keypress(function(event) {	}).mouseover(function(){	    $("#baru-container").draggable({disabled:true});    }).mouseout(function(){        $("#baru-container").draggable({disabled:false});    });		$("#baru-container").mousedown(function(){		Focus.set("baru");		setMenu_baru();			fixSizebaruSpeed = 0;	})	.mouseup(function(){		fixSizebaruSpeed = 300;	});		/* Make application resizable */	Resizable.set("baru");		$("#exit-baru").mousedown(function(){		close_baru();		$("#body-baru").val("");	});	$("#maximize-baru").mousedown(function(){		maximize_baru()	});		$("#minimize-baru").mousedown(function(){		minimize_baru()	});			fixSize_baru();}/* Fix size application */var fixSizebaruSpeed = 300;function fixSize_baru(){	setTimeout(function(){		if(LoadAppsID["baru"].onFocus){			height = $("#baru-container").height();			width = $("#baru-container").width();			$("#body-baru").css({"height" : height-45, "width" : width-5});		}		fixSize_baru();	},fixSizebaruSpeed);}/* Set application menu */function setMenu_baru(){	proIdApps = "baru";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>Baru</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_baru(proIdApps)>Minimize</li>"+			"<li onclick=maximize_baru(proIdApps)>Maximize</li>"+			"<li onclick=close_baru(proIdApps)>Quit Baru</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_baru(){	$.post("system/applications/baru/layout/baru.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_baru,100);		fixSize_baru();		applicationOpened++;	});	}/* Running application */function run_baru(dir, fileName){}